import React from "react" ; 
import RadioButton from "./RadioButton";

class RadioButtonGroup extends React.Component{
    render(){
        const categoryArray = this.props.categ.map((user,element) => {
            return <Card key={element} id={this.props.robot[element].id} name={this.props.robot[element].name} email={this.props.robot[element].email}/>  
            return <RadioButton name={this.props.categ[element].name}></RadioButton>
        }) ;
            return (
            <div class="btn-group-vertical">
                <RadioButton/>
                <RadioButton/>
            </div>
            ) ;
    }
}

export default RadioButtonGroup ;
